import React from "react";
import logo from '../../imgs/logo.jpg'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircleUser, faUser } from '@fortawesome/free-solid-svg-icons'; // Caminho relativo

function Login() {
  return (
    <div className="bg-gradient-to-r from-black to-green-500 w-screen h-screen">
        <div className="flex justify-around p-36">
            <img src={logo} alt="Logo da XYZ Distribuidora" className="w-72 h-48 border-2 border-black"/>
            <div className="w-80 h-96 bg-gradient-to-t from-green-500 to-blue-500 border-2 border-black">
              <div className="flex flex-col gap-y-10">
                <FontAwesomeIcon icon={faCircleUser} className="text-9xl mt-10"/>
                <div className="flex flex-col gap-4">
                  <div className="flex justify-center items-center">
                    <div className="bg-slate-400">
                      <FontAwesomeIcon icon={faUser} />
                    </div>
                    <input placeholder="Username"/>
                  </div>
                  <div className="flex justify-center">
                    <input placeholder="********************"/>
                  </div>
                </div>
              </div>
            </div>
        </div>
    </div>
  );
}

export default Login;
